import logo from '.././logo.svg';
import '../App.css';
import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Outlet, Link } from "react-router-dom";
import {Container, FormGroup, Table, Button, Modal, ModalHeader, ModalBody, ModalFooter} from 'reactstrap';

class App extends React.Component {
  //Seteamos un estado de la modal por defecto
  state={
    modalInsertar: false
  }

  //esta funcion cambia el estado a true
  modalInsertar=()=>{
    this.setState({
      modalInsertar:true,
    });
  }

  //esta funcion cierra la modal
  cerrarModalInsertar=()=>{
    this.setState({
      modalInsertar:false
      
    })
  }

  render(){
    return (
      <>
      <nav>
        <ul>
          <li>
            <Link to="/">Departamentos</Link>
          </li>
          <li>
            <Link to="/Empleados">Empleados</Link>
          </li>
          <li>
            <Link to="/Perfiles">Perfiles</Link>
          </li>
          <li>
            <Link to="/Personas">Personas</Link>
          </li>
          <li>
            <Link to="/Usuarios">Usuarios</Link>
          </li>
        </ul>
      </nav>
      </>
    );
  }
}

export default App;








